import { AnecdoteType } from '../App'
import AnecdoteComponent from './Anecdote'

const AnecdoteList = ({ anecdotes }: { anecdotes: AnecdoteType[] }) => (
  <div>
    <h2>Anecdotes</h2>
    <ul>
      {anecdotes.map((anecdote) => (
        <AnecdoteComponent key={anecdote.id} anecdote={anecdote} />
      ))}
    </ul>
  </div>
)

export default AnecdoteList
